class Group:
    def __init__(self):
        self.members = []
    def add(self, studentObj):
        self.members.append(studentObj)
    def remove(self, studentObj):
        self.members.remove(studentObj)
    def printMembers(self):
        for i in self.members:
            print(i.name)
